import logo from './logo.svg';
import './App.css';
import React from 'react';

function App() {
  const [minutes, setMinutes] = React.useState(0);
  const [hours, setHours] = React.useState();
  const onChange = (e) => {
    setMinutes(e.target.value);
  }
  return (
    <div className="App">
      <h2>
        super converter
      </h2>
      <div>
        <label htmlFor="minutes">Minutes</label>
        <input
          value={minutes}
          id="minutes"
          placeholder="Minutes"
          type="number"
          onChange={onChange}
        />
      </div>
      <div>
        <label htmlFor="hours">Houres</label>
        <input
          value={minutes / 60}
          id="hours"
          placeholder="Hours"
          type="number"
          disabled
        />
      </div>
    </div>
  );
}

export default App;
